package com.ecommerce.main.dao;

import java.util.List;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.jdbc.core.JdbcTemplate;
import org.springframework.stereotype.Repository;

import com.ecommerce.main.dto.ProductImagesMain;
import com.ecommerce.main.dto.ProductStatusMain;
import com.ecommerce.main.dto.ProductsMain ;
import com.ecommerce.main.Mapeer.ProductsRowMainMapper;
import com.ecommerce.main.Mapper.ProductStatusMainMapper ;
import com.ecommerce.main.Mapper.ProductImagesMainMapper ;

@Repository
public class ItemsDaoImpl implements ItemsDao {
	
	@Autowired
	JdbcTemplate jdbcTemplate ;

	public List<ProductsMain> getProductsMain(){
		return jdbcTemplate.query("Select ProductName as productName,ProductCategory as productCategory,Price as price,Quantity as quantity from Products",new ProductsRowMainMapper()) ;
	}
	public List<ProductStatusMain> getProductsStatusMain(){
		return jdbcTemplate.query("Select ProductName as ProductsName,ProductId as ProductsId,Status as status from ProductStatus",new ProductStatusMainMapper()) ;
	}
	
	/*public List<ProductImagesMain> getProductImages(){
		return jdbcTemplate.query("Select ProductName,ProductId,Status from ProductStatus", new ProductImagesMainMapper()) ;
	} */
	
	public String getImage() {
		return "data:image/jpeg;base64," ;
//		return "abc" ;
	}
	
}
